import React, { Component } from "react";
import { Container } from 'reactstrap';
import Slider from "react-slick";


const items = [
    {
        src: "/images/car1.jpg",
    },
    {
        src: "/images/car2.jpg",
    },
    {
        src: "/images/car3.jpg",
    },
    {
        src: "/images/car1.jpg",
    },
    {
        src: "/images/car2.jpg",
    },
    {
        src: "/images/car3.jpg",
    },
    {
        src: "/images/car1.jpg",
    },
    {
        src: "/images/car2.jpg",
    },
    {
        src: "/images/car3.jpg",
    }
];

const settingsSliderDesktop = {
    arrows: false,
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 6,
    slidesToScroll: 1,
    autoplay: true
  };
  const settingsSliderMobile = {
    arrows: false,
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true
  };


const Patners = () => {

    const imagePanel = items.map((item, pa) => (
        <div xs="12" sm="12" md="2" lg="4" 
        className=" justify-content-center align-self-center" key={pa} >
            <img 
            className="patners-homepage justify-content-center align-self-center"                 
            src={item.src}
            alt="stack images" />
        </div>
    ));
    return (
        <div>
             <Container fluid style={{ padding: '0px' }}>

                    <div className="patners-box">
                    <p className="text-center patner-heading">Our Patners</p>                 
                        <div className="hide-for-mobile">
                            <Slider {...settingsSliderDesktop}className="">
                                {imagePanel}
                            </Slider>
                        </div>
                        <div className="hide-for-desktop">
                            <Slider {...settingsSliderMobile}className="">
                                {imagePanel}
                            </Slider>
                        </div>                       
                    </div>
                <style global jsx>
                    {`
                        .patners-box{
                            overflow: hidden;                           
                            box-shadow: none;
                            border: none;
                            background-color: #dddddd;

                           }
                           .patner-heading{
                               padding-top: 2rem;
                               font-size: 34px;

                           }
                           .patner-image{
                               width: 30%;
                               margin-left: auto;
                               margin-right: auto;
                           }
                            @media (max-width: 768px) {
                                .giveassured-text-panel {
                                    padding: 1.5rem 0rem 1rem 0rem;                           
                                } 
                                .patner-image{
                                    width: 55%;
                               margin-left: auto;
                               margin-right: auto;
                                } 
                                .patners-box{
                                    // height: 244px;
                                }                      
                            }   
                            .homepage-new .slick-slider {
                                width: 100%;
                            }

                            .homepage-new .pointer-home {
                                cursor: pointer;
                            }



                            .homepage-new .slick-dots li button:before {
                                font-size: 20px;
                            }   
                            .patners-homepage{
                                width: 100%;
                                padding: 1rem;
                                align-self: center;
                            }
                            @media (max-width: 768px) {
                                .patners-homepage{
                                    width: 100%;
                                }
                            }    
                         `}
                </style>

            </Container>

        </div>
    )
}

export default Patners
